INSERT INTO `blog` (`blog_id`, `title`, `author`, `intro`, `URL`, `crttime`, `updtime`) VALUES
(1, '赵庭景美', 'Zhao Ting Jing Mei', '<b>location</b>: Beijing<br/>\r\n<b>occupation</b>: oil painter<br/>\r\n<b>blog visits</b>: 88, 086<br/>\r\n<br/>\r\nShe came home one night to find her husband in bed with another woman, and live cast the whole thing on her microblog.<br/>', 'http://blog.sina.com.cn/zhaotingjingmei', '2010-10-18 14:58:23', '2010-10-06 09:49:39'),
(2, '钟如九', 'Zhong Rujiu', '<b>age</b>: 22<br/>			<b>location</b>: Yihuang county, Jiangxi<br/>\r\n<b>microblog readership</b>: 31,966<br/>\r\n<br/>\r\nChased by local police on her way to Beijing to petition against the forced demolition of her family’s home, she and her sister locked  themselves in the airport washroom and began texting bloggers and journalists for help.<br/>', 'http://t.sina.com.cn/n/钟如九', '2010-10-18 15:00:25', '2010-10-06 09:53:01'),
(3, '洪晃', 'Hong Huang', 'b>location</b>: Beijing<br/\r\n<b>occupation</b>: Chief executive of China Interactive Media Group<br/>\r\n<b>blog visits</b>: 113,369,616<br/>\r\n<br/>\r\nShe is an influential media mogul, publisher of fashion magazines, the ex-wife of a famous film director, a mother, and the daughter of a diplomatic family. <br/>', 'http://blog.sina.com.cn/honghuang', '2010-10-18 15:02:31', '0000-00-00 00:00:00'),
(4, '流氓燕', 'Hooligan Sparrow', '<b>location</b>: Wuhan<br/>\r\n<b>occupation</b>: community organizer<br/>\r\n<b>blog visits</b>: 3,048,638<br/>\r\n<br/>\r\nShe first caused a sensation for posting nude photos of herself online, and writing candidly about sex and relationships. She now runs a women''s rights organization and was recently detained by authorities for organizing a petition campaign for the legalization of sex work after a government “vice crackdown” on pornography and prostitution. <br/>', 'http://452598814.qzone.qq.com/', '2010-10-18 15:03:30', '0000-00-00 00:00:00'),
(5, '丁婆', 'Dimple', '<b>location</b>: Montreal, Canada\r\n<br/>\r\n<b>occupation</b>: student, translator<br/>\r\n<b>blog hits</b>: 13<br/>\r\n<br/>\r\nSome things in her life are easier to say online, to total strangers, than to tell her friends.<br/>', 'http://dimplewan.wordpress.com/', '2010-10-18 15:04:34', '0000-00-00 00:00:00');
